import React from 'react'
import {BrowserRouter,Switch, Route} from 'react-router-dom';

import Landing from './pages/landing'

function Routes (){
    return(
        <BrowserRouter>
            <Route path='/' component={landing}/>
        </BrowserRouter>
    )
};

export default Routes
